Manchester United legend Antonio Valencia opened up about heroically stepping in to prevent a man taking his own life on a bridge a few days ago 🙏

🗣️ “Let’s take care of ourselves, please. Our minds, our hearts. Mental health is very important. Life is very fragile.”

The episode, which could have turned into a tragedy, ended with the arrival of the man’s relatives ❤️

Massive respect to the Ecuadorian 👏

If someone you know is struggling with their mental health, encourage them to seek professional help and offer support. You also can speak to the following organisations:

